import { Container, Row, Col } from 'reactstrap';
// import { push } from 'connected-react-router'
// import { bindActionCreators } from 'redux'
// import { connect } from 'react-redux'
// import ReactTable from "react-table";

class LicenseBox extends Component {
	constructor(props) {
		super(props);
		let lics = props.match.params.license.split(',');
		this.state = {
			'name': '',
			'license': lics,
			'licenseDetails': [{organization:''}],
			'similarLicenses': null,
			'displayedLicense': 0,
			'visits': null,
			'violations': null,
			'vvOrdered': null,
		}
		// Loop through all the licenses and grab the details we need
		this.getLicenseDetails();
		this.getVisits();
		this.getViolations();
	}

	render(){ 
		return (<Container><Row><Col>lic box</Col></Row></Container>)
	}
}

export default LicenseBox;
